import React from 'react';
import { useLocation } from 'react-router-dom';
import Header from './Header';
import Footer from './Footer';
import image1 from './Images/image1.jpeg';

function AboutUs(){
    const location = useLocation();
    const params = new URLSearchParams(location.search);
    const userType = params.get('userType');
    const userName = params.get('userName');

    return(
        <>
            <div>
                <Header type={userType} name={userName} />
                <div className='my-4 d-flex flex-column justify-content-center align-items-center text-center'>
                    <h1 className='my-3'>The Team</h1>
                    <div className='container-fluid justify-content-center align-items-center text-center'>
                        <div className='card mx-3'>
                            <div className='row'>
                                <div className='col mx'>
                                    <img className='rounded-circle w-25' src={image1} alt='Nafees'></img>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <Footer />
            </div>
        </>
    );
}

export default AboutUs;
